package com.example.ProjectApi.entity;

import java.util.Date;

public class Rollcall {
	public Rollcall() {
		// TODO Auto-generated constructor stub
	}
	String Rollcall_result;
	Date Rollcall_time;
	String class_id;
	String student_id;
	public String getRollcall_result() {
		return Rollcall_result;
	}
	public void setRollcall_result(String rollcall_result) {
		Rollcall_result = rollcall_result;
	}
	public Date getRollcall_time() {
		return Rollcall_time;
	}
	public void setRollcall_time(Date rollcall_time) {
		Rollcall_time = rollcall_time;
	}
	public String getClass_id() {
		return class_id;
	}
	public void setClass_id(String class_id) {
		this.class_id = class_id;
	}
	public String getStudent_id() {
		return student_id;
	}
	public void setStudent_id(String student_id) {
		this.student_id = student_id;
	}
	
	

}
